import React from "react";
import { useNavigate } from 'react-router-dom';
import { Button } from "reactstrap";

function UpdatePost()
{
    const navigate = useNavigate();

    return(
        <>
         <Button color="primary" onClick={() => navigate('/')} type="submit">Home</Button>
        </>
    )
}

export default U
